"use strict";

function myAtoi(s) {
    if (!s) {
        return 0;
    }
    const n = s.length;
    if (n === 0) {
        return 0;
    }
    let i = 0;
    while (s[i] === ' ') {
        i++;
        if (i === n) {
            return 0;
        }
    }
    const sign = s[i] === '-' ? -1 : 1;
    if (s[i] === '-' || s[i] === '+') {
        i++;
    }
    let res = 0, flag = Math.floor(Math.pow(2, 31) - 1) / 10;
    while (i < n) {
        if (!isNaN(s[i]) && s[i] !== ' ') {
            const c = parseInt(s[i]);
            if (res > flag || (res === flag && c > 7)) {
                return sign > 0 ? Math.pow(2, 31) - 1 : -Math.pow(2, 31);
            }
            res = res * 10 + c;
        } else {
            break;
        }
        i++;
    }
    return sign * res;
}
